import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Paper, Tabs, Tab } from "@material-ui/core";
import { indigo } from "@material-ui/core/colors";
import { AccessTime, NotificationsActive, Face } from "@material-ui/icons";
import { withRouter } from "react-router-dom";

const drawerWidth = 230;
const DashboardDrawer = props => {
  const classes = useStyles();
  const [ value, setValue ] = useState(0);
  const handleChange = (event, newValue) => {
    setValue(newValue);
    switch (newValue) {
      case 0: return props.history.push("/dashboard");
      case 1: return props.history.push("/dashboard/announcements");
      case 2: return props.history.push("/dashboard/profile");
    }
  }
  return (
    <Paper square className={classes.root}>
      <Tabs
        value={value}
        onChange={handleChange}
        variant="fullWidth"
        indicatorColor="primary"
        textColor="primary"
        aria-label="icon tabs example"
      >
        <Tab icon={<PhoneIcon />} aria-label="phone" />
        <Tab icon={<FavoriteIcon />} aria-label="favorite" />
        <Tab icon={<PersonPinIcon />} aria-label="person" />
      </Tabs>
    </Paper>
  );
};

const useStyles = makeStyles(theme => ({
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
    marginTop: "60px",
    background: "blue"
  },
  drawerPaper: {
    width: drawerWidth,
    marginTop: "64px",
    background: indigo[700],
    color: "white"
  },
  drawerHeader: {
    display: 'flex',
    alignItems: 'center',
    padding: theme.spacing(0, 1),
    ...theme.mixins.toolbar,
    justifyContent: 'flex-end',
  }
}));

export default withRouter(DashboardDrawer);
